description:
Print Craft Sign Blanks make it very quick and easy to build signs. Simply add any logos and text that you would like and you are ready to output a professional looking sign. The Print Craft Sign Blanks also come with an .eps cut contour for each shape. This can be used as a cut path (obviously) or a clipping mask allowing you  to incorporate the sign into a larger design. 




500 Sign Blanks

